import React, {useState, useEffect} from "react";
import {makeStyles} from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import Button from '@material-ui/core/Button';
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import Table from '@material-ui/core/Table';
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";
import DeleteSweepOutlinedIcon from '@material-ui/icons/DeleteSweepOutlined';
import EditIcon from '@material-ui/icons/Edit';
import {BrowserRouter as Rounter, Route, Link, NavLink, Switch} from 'react-router-dom';
import AddCircleIcon from '@material-ui/icons/AddCircle';
import Modal from '@material-ui/core/Modal';
import axios from "axios";
import Chip from '@material-ui/core/Chip';

// import "../../Css/Fee/Fee.css"
// import "./Fee.css"
//import {useParam} from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
    root: {
        minWidth: 275,
    },
    heder: {
        width: '100%',
        padding: theme.spacing(1),
        marginTop: '4%',
    },
    Cards: {
        width: '78%',
        padding: theme.spacing(2),
        marginLeft: '6%'
    },
    Dialogcards: {
        width: '100%',
        padding: theme.spacing(5),
        margin: 'auto',
    },
    Card: {
        width: '83%',
        padding: theme.spacing(3),
        margin: 'auto',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
    Btn: {
        marginLeft: "88%",
        marginTop: "0.5%",
    },
    head: {
        marginLeft: "12%",
    },
    modal: {
        position: 'absolute',
        width: 400,
        backgroundColor: theme.palette.background.paper,
        padding: theme.spacing(2, 4, 3),
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)'
    },
    iconos: {
        cursor: 'pointer'
    },
    inputMaterial: {
        width: '100%'
    },
    frame: {
        width: 1124,
        height: 654
    },
    infame: {
        width: 798,
        height: 446,
        border: '1px solid #AAAAAA',
    },
    IconSize: {
        width: '3%',
        height: '3%',
        marginLeft: '2%'
    },
    TitleMargin: {
        marginTop: '1%',
        marginLeft: '1%',
        marginBottom: '2%'
    },
    tableCell: {
        margin: theme.spacing(2, 4, 3),
    }
}));

export default function CreateFeetype(props) {

    const [open, setOpen] = React.useState(false);
    const classes = useStyles();
    const handleClickOpen = () => {
        setOpen(true)
    };

    const handleClose = () => {
        setOpen(false);
    };

    const [feetype, setFeetype] = useState([]);
    const [userId, setUserId] = useState("");
    const [addFeetypename, setAddfeetypename] = useState("");
    const [addFeeprice, setAddfeeprice] = useState("");
    const [modalEdit, setModalEdit] = useState(false);
    const [modaldelete, setModalDelete] = useState(false);

    useEffect(() => {
        axios('/feetype/fee-types')
            .then(response => {
                console.log(response.data)
                setFeetype(response.data);
            })
            .catch(error => {
                console.log('Error getting fake data: ' + error);
            })
    }, []);

    const addFeetype = () => {
        axios.post("/feetype/fee-type/", {
            "FeeTypeName": addFeetypename,
            "FeeTypePrice": parseInt(addFeeprice)

        }).then(() => {
            setFeetype([
                {
                    ...feetype,
                    FeeTypeName: addFeetypename,
                    FeeTypePrice: parseInt(addFeeprice)
                },
            ]);
            window.location.href = '/createfeetype';
        });
        setOpen(false)
    };

    const deletetable = (id) => {
        axios.post(`/feetype/fee-type/${id}`).then(() => {
            setFeetype(feetype.filter((row) => {
                    return row.id != id;
                })
            );
        });
    };

    const selectFeetype = (rows, data) => {
        setAddfeetypename(rows);
        setAddfeeprice(rows);
        (data === 'Edit')
            ?
            EditModal()
            : Modals()
    }

    const EditModal = () => {
        setModalEdit(!modalEdit);
    }

    const Modals = () => {
        setModalDelete(!modaldelete);
    }

    const UpdateFeetype = (id) => {
        axios.post("/feetype/edit-fee-type/" + id, feetype, {
            "id": id,
            "FeeTypeName": addFeetypename,
            "FeeTypePrice": parseInt(addFeeprice)
        }).then(() => {
            setFeetype([
                {
                    ...feetype,
                    id: userId,
                    FeeTypeName: addFeetypename,
                    FeeTypePrice: parseInt(addFeeprice)
                },
            ]);
        });
        setOpen(false)
    };

    const submittFeeset = () => {
        axios('', {}).then(() => {

        })
    }

    const EditTextfeild = (
        <div className={classes.modal}>
            <DialogContentText>
                <DialogTitle id="edit-apartment">Create Fee Type</DialogTitle>

                <input
                    name="FeetypeName"
                    label="FeetypeName"
                    className={classes.inputMaterial}
                    id="FeetypeName"
                    onChange={(event) => {
                        setAddfeetypename(event.target.value);
                    }}
                    value={addFeetypename.feeTypeName}/>
                <br/>
                <br/>
                <input
                    name="FeetypePrice"
                    label="FeetypePrice"
                    id="FeetypePrice"
                    className={classes.inputMaterial}
                    onChange={(event) => {
                        setAddfeeprice(event.target.value);
                    }}
                    value={addFeeprice.feeTypePrice}/>
                <br/>

            </DialogContentText>
            <br/><br/>
            <div align="right">
                <Button
                    onClick={() => UpdateFeetype()}
                    variant="contained"
                    disableElevation
                    style={{backgroundColor: '#485D84'}}
                    color="primary">Edit</Button>
                <Button onClick={() => EditModal()}>cancel</Button>
            </div>
        </div>
    )

    return (
        <div className={classes.frame}>
            <Card className={classes.Card} variant="outlined">
                <h4 className={classes.TitleMargin}> Fee Types
                    <AddCircleIcon className={classes.IconSize} onClick={handleClickOpen} color="primary"/>
                </h4>
                <hr/>

                <div className="container">
                    <Card className={classes.Cards} variant="outlined">
                        <Table>
                            <tbody>
                            {feetype.map((row) => (
                                <TableRow>
                                    <TableCell>{row.userId}</TableCell>
                                    <TableCell className={classes.tableCell} >{row.feeTypeName}</TableCell>
                                    <TableCell>
                                        <Chip label={row.feeTypePrice}/>
                                    </TableCell>
                                    <TableCell>
                                        <Button
                                            onClick={() => selectFeetype(row, "Edit")}><EditIcon/></Button>
                                    </TableCell>
                                    <TableCell>
                                        <Button onClick={() => {
                                            deletetable(row.id)
                                        }}><DeleteSweepOutlinedIcon/></Button>
                                    </TableCell>
                                </TableRow>
                            ))}
                            </tbody>
                        </Table>
                    </Card>
                </div>

                <h5 className={classes.head}>
                    <Dialog
                        open={open}
                        onClose={handleClose}
                        aria-labelledby="edit-apartment">
                        <DialogTitle id="edit-apartment">Create Fee Type Name</DialogTitle>
                        <DialogContent>
                            <DialogContentText>
                                <input
                                    placeholder="Feetype name"
                                    type="text"
                                    name="Feetype name"
                                    fullWidth
                                    //value={addFeetypename}
                                    onChange={(event) => {
                                        setAddfeetypename(event.target.value);
                                    }}
                                />
                            </DialogContentText>
                            <DialogContentText>
                                <input
                                    placeholder="Feetype price"
                                    type="number"
                                    name="Feetype price"
                                    fullWidth
                                    //value={addFeeprice}
                                    onChange={(event) => {
                                        setAddfeeprice(event.target.value);
                                    }}
                                />
                            </DialogContentText>
                        </DialogContent>
                        <DialogActions>
                            <Button variant="contained" color="primary" disableElevation
                                    onClick={addFeetype}
                                    style={{backgroundColor: '#485D84'}}>
                                Create
                            </Button>
                            <Button variant="contained" disableElevation
                                    onClick={handleClose}>
                                cancel
                            </Button>
                        </DialogActions>
                    </Dialog>
                </h5>

                <Modal
                    open={modalEdit}
                    onClose={EditModal}>
                    {EditTextfeild}
                </Modal>

                <div className="container-fruid ">
                    <NavLink to="/setting">
                        <Button className={classes.Btn}
                                variant="contained" color="primary" disableElevation
                                style={{backgroundColor: '#485D84'}}>Save
                        </Button>
                    </NavLink>
                </div>
            </Card>
        </div>
    );
